import React from "react";
import DUMMY_DATA from "../Data/data";
import MeetUpList from "../components/MeetUps/MeetUpList"

const AllMeetUps = () => {
    return (
        <section>
            <h1>All MeetUps</h1>
            <MeetUpList meetups={DUMMY_DATA}/>
        </section>
    );
}
export default AllMeetUps;
